jQuery(document).ready(function($){
/* Fix for sidebar display 959pixels and wider even if closed manually (CSS is display:block !important;) */
function checkWindowSize() {

    if ( $(window).width() > 959 ) {
        $('#sidebar-widgets').addClass('displayside');
    }
    else {
        $('#sidebar-widgets').removeClass('displayside');
    }

}
$(window).load(checkWindowSize);
$(window).resize(checkWindowSize);


/* Fix for sidebar display 959pixels and wider even if closed manually (CSS is display:block !important;) */
function checkWindowSize2() {

    if ( $(window).width() > 959 ) {
        $('body.page-template-page-full-width-php #sidebar-widgets').removeClass('displayside');
    }
    else {
        $('body.page-template-page-full-width-php #sidebar-widgets').removeClass('displayside');
    }

}
$(window).load(checkWindowSize2);
$(window).resize(checkWindowSize2);

});









